window.onscroll = function() {myFunction()};

function myFunction() {

    if (window.pageYOffset > sticky) {
  
      header.classList.add("sticky");
  
    } else {
  
      header.classList.remove("sticky");
  
    }
  
  }

function Header() {

    return(
        <>
        <br/>
        <div className='border static rounded-md px-3 bg-gradient-to-r from-green to-yellow py-3 shadow grid grid-cols-2 m-1 mx-4 text-white'>
            <header>
            <p>UBD HEP Counseling</p>
            <ul className='list-none flex flex-row justify-end space-x-3 font-sans'>
                <li><a href="#">Home</a></li>
                <li><a href="#">Products</a></li>
                <li><a href="#">Team</a></li>
                <li><a href="#">Contacts</a></li>
            </ul>
            </header>
        </div>
        </>
    )

}

export default Header;
